import React from 'react'

export default function Table({headings,data}) {
  return (
    <table class="table table-hover">
    <thead>
      <tr>
          {headings.map((item)=>{
              return <th scope="col">item</th>

          })}
      </tr>
    </thead>
    <tbody>
        {data.map((item)=>{
            return (<tr>
            {item.map((it)=>{
                return (<td>{it}</td>)
            })
        }
            </tr>
            )
        })}
          )
    </tbody>
  </table>  )
}
